const { describe, test } = require('@jest/globals');
const { exportarJPG } = require('../../../src/utils/exportarCrachas.util');
const exportarConfig = require('../../../src/configs/exportar.config');
const fs = require('fs');
const path = require('path');

const crachas = [
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,'
]

test('Exportar um Crachá para JPG', async () => {
  const fileName = await exportarJPG([crachas[0]]);
  const filePath = path.join(__dirname, '../../../', exportarConfig.exportPath, `jpg/${fileName}`);

  expect(path.extname(filePath)).toBe('.jpg');
  expect(fs.existsSync(filePath)).toBe(true);

  fs.unlinkSync(filePath);
});

test('Exportar vários Crachás para JPG como um arquivo ZIP', async () => {
  const fileName = await exportarJPG(crachas);
  const filePath = path.join(__dirname, '../../../', exportarConfig.exportPath, `jpg/${fileName}`);

  expect(path.extname(filePath)).toBe('.zip');
  expect(fs.existsSync(filePath)).toBe(true);

  fs.unlinkSync(filePath);
});